INSERT INTO `film` (`id`, `title`, `durasi`, `id_genre`, `id_writer`, `id_director`, `photo`, `rating`, `deskripsi`) VALUES
(1, 'Joker', 120, 1, 1, 1, , 8.5, 'Forever alone in a crowd, failed comedian Arthur Fleck seeks connection as he walks the streets of Gotham City. Arthur wears two masks -- the one he paints for his day job as a clown, and the guise he projects in a futile attempt to feel like he\'s part of the world around him. Isolated, bullied and disregarded by society, Fleck begins a slow descent into madness as he transforms into the criminal mastermind known as the Joker.');
INSERT INTO `film` (`id`, `title`, `durasi`, `id_genre`, `id_writer`, `id_director`, `photo`, `rating`, `deskripsi`) VALUES
(2, 'Parasite', 120, 2, 2, 2, , 8.5, 'is a 2019 South Korean drama film directed by Bong Joon-ho, who also co-wrote the screenplay with Han Jin-won. It stars Song Kang-ho, Lee Sun-kyun, Cho Yeo-jeong, Choi Woo-shik, Park So-dam, Jang Hye-jin, and Lee Jung-eun and follows the members of a poor family who scheme to become employed by a wealthy family by infiltrating their household and posing as unrelated, highly qualified individuals.\r\n\r\nParasite premiered at the 2019 Cannes Film Festival on 21 May 2019, where it became the first South Korean film to win the Palme d\'Or. It was then released in South Korea by CJ Entertainment on 30 May 2019.\r\n\r\nThe film received unanimous critical acclaim and was considered by many critics as the best film of 2019 as well as one of the best films of the 2010s. It grossed over $266 million worldwide on a production budget of about $11 million, becoming the highest-grossing South Korean film. Among its numerous accolades, Parasite won a leading four awards at the 92nd Academy Awards: Best Picture, Best Director, Best Original Screenplay, and Best International Feature Film, becoming the first film not in English to win the Academy Award for Best Picture.[note 1] It was also the first South Korean film to receive Academy Award recognition, and the first film since 1955\'s Marty (and third film overall) to win both the Palme d\'Or and the Academy Award for Best Picture. It also won the Golden Globe Award for Best Foreign Language Film and the BAFTA Award for Best Film Not in the English Language, and became the first film not in English to win the Screen Actors Guild Award for Outstanding Performance by a Cast in a Motion Picture.');
INSERT INTO `film` (`id`, `title`, `durasi`, `id_genre`, `id_writer`, `id_director`, `photo`, `rating`, `deskripsi`) VALUES
(3, '1917', 120, 3, 3, 3, , 8.3, '1917 is a 2019 war film directed, co-written, and produced by Sam Mendes. The film stars George MacKay and Dean-Charles Chapman, with Mark Strong, Andrew Scott, Richard Madden, Claire Duburcq, Colin Firth and Benedict Cumberbatch in supporting roles. It is based in part on an account told to Mendes by his paternal grandfather, Alfred Mendes.[7] The film tells the story of two young British soldiers during the First World War who are ordered to deliver a message calling off an attack doomed to fail soon after the German retreat to the Hindenburg Line during Operation Alberich in 1917. This message is especially important to one of the soldiers, as his brother is taking part in the pending attack.\r\n\r\nThe project was officially announced in June 2018, with MacKay and Chapman signing on in October and the rest of the cast the following March. Filming took place from April to June 2019 in the UK, with cinematographer Roger Deakins and editor Lee Smith using long takes to have the entire film appear as two continuous shots.[8][9][10]');
INSERT INTO `film` (`id`, `title`, `durasi`, `id_genre`, `id_writer`, `id_director`, `photo`, `rating`, `deskripsi`) VALUES
(4, 'The Platform', 80, 4, 4, 4, , 7, 'The film is set in a large, tower-style \"Vertical Self-Management Center\". Its residents, who are periodically switched at random between its many floors, are fed via a platform which, initially filled with food at the top floor, gradually descends through the tower\'s levels, each level getting only the leftovers from the previous ones. It is a system bound to cause conflict, as the residents at the top levels can eat as much as they can, leaving increasingly little for those below.\r\n\r\nThe film\'s cast includes Iv√°n Massagu√©, Antonia San Juan, Zorion Eguileor, Emilio Buale Coka and Alexandra Masangkay.\r\n\r\nThe film premiered at the 2019 Toronto International Film Festival, where it won the People\'s Choice Award for Midnight Madness. At TIFF, the film also secured a worldwide streaming deal with Netflix. It was released on the streaming service on 20 March 2020.');
